import client from '../config/apollo';
import PedidoState from '../context/pedidos/PedidoState'

const MyApp = ({ Component, pageProps}) => {
    return(
        <ApolloProvider client={client}>
            <PedidoState>
                <Component {...pageProps} />
            </PedidoState>
        </ApolloProvider>
    )
}

export default MyApp;
